sys_variable_value.value:
(function execute(inputs, outputs) {
    if(inputs.status_code == 200){
        responseBody = JSON.parse(inputs.response_body);
        outputs.completions = responseBody.completions;
        outputs.model_version = responseBody.model_version;
    }
})(inputs, outputs);

